(261, 1, '2019-05-01 09:43:47', '2019-05-01 09:43:47', '[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n<h1>Hvad behandler vi?</h1>\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Musculupati</h2>\r\nMusculupati kan hjælpe dig, hvis du har muskulære problematikker. Dette kan enten være på baggrund af en dårlig kropsholdning, forkert arbejdsstilling, eller en sportsskade. Ligeledes kan Musculupati bruges til at opnå hurtigere restitution, hvis man dyrker sport på eliteniveau som atlet eller træning som motionist. Hvis du lider af problematikker som generel anspændthed i kroppen, spændinger i nakkeområdet eller lider af en decideret spændingshovepine, tennis/golfalbue, løberknæ, føleforstyrrelser/sovende fornemmelse i arme eller ben (piriformissyndrom), ondt/spændt i ryggen eller lænden, nedsat kraft i musklerne eller nedsat bevægelighed i led, så kan Musculupati hjælpe dig. Tøv ikke med at kontakte os, hvis du har spørgsmål til om vi kan hjælpe dig med din problematik.\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Priser</h2>\r\n120 min - 1000,-\r\n90 min - 800,-\r\n60 min - 600,-\r\n45 min - 500,-\r\n30 min - 400,-\r\n\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n\r\n<hr />\r\n\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Cupping terapi</h2>\r\nCupping terapi er inkluderet i en Musculupati behandling, hvis det vurderes relevant for din problematik, men cupping tilbydes også som en seperat behandling. Cupperne skaber et undertryk, som i det påsatte område gør at blodkarrene udvider sig, hvortil vævet og musklerne forsynes med friskt blod, ilt og næringsstoffer. Ligeledes øges blodgennemstrømningen i området, hvor temperaturen stiger og derved dræber bakterierne og på den måde frigives affaldsstofferne. Efter en cupping behandling er det derfor vigtigt at drikke rigeligt med vand, for at skylle de frigivne affaldsstoffer ud.\r\nHvis du tager antikoagulerende medicin, skal du rådføre dig med egen læge inden bestilling  af en cuppingbehandling.\r\n\r\nInden cupperne påsættes, varmes området op manuelt hvorefter cupperne sættes på i  15 min. Ved bestilling af Cupping terapi, er det muligt at vælge om man vil have cuppet 1, 2 eller 3 forskellige områder på kroppen. Områderne er opdelt således: bagside ben - ryg og nakke - forside ben - arme. Ved ønsket cupping af flere områder, cuppes 1 område af gangen.\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Priser</h2>\r\nCupping af 1 område, 30 min - 300,-\r\nCupping af 2 områder, 45 min - 400,-\r\nCupping af 3 områder, 60 min - 500,-\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n\r\n<hr />\r\n\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n\r\nSå <a href=\"https://localhost/wordpress/sem4-hovedopgave-wp/kontakt/\">kontakt</a> os eller <a href=\"https://localhost/wordpress/sem4-hovedopgave-wp/booking/\">book</a> en tid!\r\n\r\n[/lgc_column]', 'Priser og behandlinger', '', 'publish', 'closed', 'closed', '', 'priser-og-behandlinger', '', '', '2020-08-07 21:00:38', '2020-08-07 20:00:38', '', 0, 'http://localhost/4-semester/sem4-hovedopgave-wp/?page_id=261', 0, 'page', '', 0),
