(375, 1, '2020-07-21 13:56:44', '2020-07-21 12:56:44', '[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\n<h1>Hvad behandler vi?</h1>\n[/lgc_column]\n\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\n\nMusculupatien kan hjælpe dig med muskulære ubalancer i din krop. Dette kan enten være på baggrund af en dårlig kropsholdning, forkert arbejdsstilling, eller en sportsskade. Ligeledes kan Musculupati bruges til at opnå hurtigere restitution, hvis man dyrker hård træning, hvor især pulsering og akupressur er effektive metoder til at få musklerne afspændt. De mest almindelige muskulære problematikker som Musculupati kan afhælpe med er bla. generel anspændthed, spændingshovedpine, tennis/golfalbue, løberknæ, føleforstyrrelser i arme og ben, ondt i ryg/lænd.\nI forlængelse af behandlingen, gives du enkle øvelser som kan laves derhjemme, for at styrke de områder på kroppen, som kræver dette for at genoprette balancen i muskulaturen.\nTøv ikke med at kontakte os, hvis du har spørgsmål til om vi kan hjælpe dig med din problematik.\n\n[/lgc_column]\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\n\nMusculupati\n\n&nbsp;\n\nSå <a href=\"https://adnanbacic.dk/folders/wordpress/victor-fysio/kontakt/\">kontakt</a> os eller <a href=\"https://adnanbacic.dk/folders/wordpress/victor-fysio/booking/\">book</a> en tid!\n\n[/lgc_column]\n\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\n<h2>Cupping terapi</h2>\nCupping terapi er inkluderet i en Musculupati behandling, hvis det vurderes relevant for din problematik, men cupping tilbydes også som en seperat behandling. Cupperne skaber et undertryk, som i det påsatte område gør at blodkarrene udvider sig, hvortil vævet og musklerne forsynes med friskt blod, ilt og næringsstoffer. Ligeledes øges blodgennemstrømningen i området, hvor temperaturen stiger og derved dræber bakterierne og på den måde frigives affaldsstofferne. Efter en cupping behandling er det derfor vigtigt at drikke rigeligt med vand, for at skylle de frigivne affaldsstoffer ud.\nHvis du tager antikoagulerende medicin, skal du rådføre dig med egen læge inden bestilling  af en cuppingbehandling.\n\nInden cupperne påsættes, varmes området op manuelt hvorefter cupperne sættes på i  15 min. Ved bestilling af Cupping terapi, er det muligt at vælge om man vil have cuppet 1, 2 eller 3 forskellige områder på kroppen. Områderne er opdelt således: bagside ben - ryg og nakke - forside ben - arme. Ved ønsket cupping af flere områder, cuppes 1 område af gangen.\n\n[/lgc_column]\n\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\n<h2>Priser</h2>\nCupping af 1 område = 30 min - 250kr\nCupping af 2 områder = 45 min - 350kr\nCupping af 3 områder = 60 min - 400kr\n\n[/lgc_column]', 'Priser og behandlinger', '', 'inherit', 'closed', 'closed', '', '261-autosave-v1', '', '', '2020-07-21 13:56:44', '2020-07-21 12:56:44', '', 261, 'http://localhost/4-semester/sem4-hovedopgave-wp/2019/06/05/261-autosave-v1/', 0, 'revision', '', 0),
(376, 1, '2019-06-05 23:40:33', '2019-06-05 22:40:33', '[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n<h1>Priser og behandlinger</h1>\r\n[/lgc_column]\r\n\r\nHer på siden kan du læse om de tilbud klinikken tilbyder. Det er meget hyppigt og oftest sports skader, som bliver behandlet på klinikken. Men jeg har specialiseret mig i fysiurgisk massage, hvor der virkelig bliver gået i dybden og arbejdet med behandling af kroppens muskler og led. Massage kan også være med til at løsne ømme områder op, hvis du f.eks har stået op hele dagen eller sovet i en forkert stilling, kan jeg afhjælpe dette via massage.\r\n<p style=\"text-align: left;\">[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]</p>\r\n<p style=\"text-align: left;\">30 min. specifik regionsmassage/helsemassage = 200 kr.</p>\r\n<p style=\"text-align: left;\">1 times specifik regionsmassage = 310 kr.</p>\r\n<p style=\"text-align: left;\">2 timers specifik regionsmassage = 580 kr.</p>\r\n<p style=\"text-align: left;\">[/lgc_column]</p>', 'Priser og behandlinger', '', 'inherit', 'closed', 'closed', '', '261-revision-v1', '', '', '2019-06-05 23:40:33', '2019-06-05 22:40:33', '', 261, 'http://localhost/4-semester/sem4-hovedopgave-wp/2019/06/05/261-revision-v1/', 0, 'revision', '', 0),
