(441, 1, '2019-06-18 14:32:06', '2019-06-18 13:32:06', '[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n<h1>Priser og behandlinger</h1>\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n\r\nHer på siden kan du læse om de tilbud klinikken tilbyder. Det er meget hyppigt og oftest sports skader, som bliver behandlet på klinikken. Men jeg har specialiseret mig i fysiurgisk massage, hvor der virkelig bliver gået i dybden og arbejdet med behandling af kroppens muskler og led. Massage kan også være med til at løsne ømme områder op, hvis du f.eks har stået op hele dagen eller sovet i en forkert stilling, kan jeg afhjælpe dette via massage.\r\n\r\n[/lgc_column]\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n\r\n30 min. specifik regionsmassage/helsemassage = 200 kr.\r\n\r\n1 times specifik regionsmassage = 310 kr.\r\n\r\n2 timers specifik regionsmassage = 580 kr.\r\n\r\nSå <a href=\"https://adnanbacic.dk/folders/wordpress/victor-fysio/kontakt/\">kontakt</a> os eller <a href=\"https://adnanbacic.dk/folders/wordpress/victor-fysio/booking/\">book</a> en tid!\r\n\r\n[/lgc_column]', 'Priser og behandlinger', '', 'inherit', 'closed', 'closed', '', '261-revision-v1', '', '', '2019-06-18 14:32:06', '2019-06-18 13:32:06', '', 261, 'https://adnanbacic.dk/folders/wordpress/victor-fysio/2019/06/18/261-revision-v1/', 0, 'revision', '', 0),
(447, 1, '2020-07-21 14:22:35', '2020-07-21 13:22:35', '<div>\n<div>[smartslider3 slider=4]</div>\n<div> </div>\n</div>\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\n<div class=\"n2-ss-layer n2-ow\" data-pm=\"normal\" data-desktopportraitmargin=\"0|*|0|*|0|*|0|*|px+\" data-desktopportraitheight=\"0\" data-has-maxwidth=\"0\" data-desktopportraitmaxwidth=\"0\" data-cssselfalign=\"center\" data-desktopportraitselfalign=\"center\" data-sstype=\"layer\" data-rotation=\"0\" data-desktopportrait=\"1\" data-desktoplandscape=\"1\" data-tabletportrait=\"1\" data-tabletlandscape=\"1\" data-mobileportrait=\"1\" data-mobilelandscape=\"1\" data-adaptivefont=\"0\" data-desktopportraitfontsize=\"100\" data-plugin=\"rendered\">\n<h1>Hvad er Musculupati?</h1>\n</div>\n<div>[/lgc_column]</div>\n<div> </div>\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\n<div>Musculupatuddannelsen er en overbygning på massør- og sportsmassøruddannelsen på AM massageskole. Ligeledes er det en beskyttet titel, som giver dig som forbruger en sikkerhed i at behandlingen er kvalificeret, da det indenfor alternativ behandling kan være svært at differenciere kvaliteten.  <br />En Musculupatbehandling er en manuel muskulær behandlingsform, som bruger forskellige behandlingsteknikker til at afhælpe dit problem. I Musculupatien kigger vi på årsagen til dit problem fremfor at behandle symptomerne. Ligeledes tager vi højde for, hvordan psyken og fysikken kan påvirke hinanden. Nogle af de teknikker som bruges i Musculupatien er bla. fysiururgisk massage, pulsering, akupressur (dybe tryk), myofacsial release. <br />Ud fra et interview og en bevægeanalyse, sammensættes den optimale behandling for netop din problematik. <br />Tøv ikke med at kontakte os, hvis du har spørgsmål til behandlingen.</div>\n<div>[/lgc_column]</div>\n<div> </div>\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\n<div style=\"text-align: center;\">[maxbutton id=\"1\" ]</div>\n<div>[/lgc_column]</div>\n<div>\n<div class=\"csRow\">\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\n</div>\n</div>\n<div>\n<div class=\"csRow\">\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\n</div>\n</div>\n<!-- wp:paragraph --><!-- /wp:paragraph -->', 'Forside', '', 'inherit', 'closed', 'closed', '', '8-autosave-v1', '', '', '2020-07-21 14:22:35', '2020-07-21 13:22:35', '', 8, 'http://localhost/wordpress/sem4-hovedopgave-wp/2020/07/08/8-autosave-v1/', 0, 'revision', '', 0);
