(548, 1, '2020-07-28 22:09:14', '2020-07-28 21:09:14', '<div>\r\n<div>[smartslider3 slider=4]</div>\r\n<div> </div>\r\n</div>\r\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\r\n<div class=\"n2-ss-layer n2-ow\" data-pm=\"normal\" data-desktopportraitmargin=\"0|*|0|*|0|*|0|*|px+\" data-desktopportraitheight=\"0\" data-has-maxwidth=\"0\" data-desktopportraitmaxwidth=\"0\" data-cssselfalign=\"center\" data-desktopportraitselfalign=\"center\" data-sstype=\"layer\" data-rotation=\"0\" data-desktopportrait=\"1\" data-desktoplandscape=\"1\" data-tabletportrait=\"1\" data-tabletlandscape=\"1\" data-mobileportrait=\"1\" data-mobilelandscape=\"1\" data-adaptivefont=\"0\" data-desktopportraitfontsize=\"100\" data-plugin=\"rendered\">\r\n<h1>Hvad er Musculupati?</h1>\r\n</div>\r\n<div>[/lgc_column]</div>\r\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\r\n<div>\r\n<h4 dir=\"auto\"><strong>I August måned er der halv pris på alle behandlinger, så du kan prøve en behandling.</strong></h4>\r\n<h4 dir=\"auto\"><strong>Brug rabatkoden: August50</strong></h4>\r\n<div dir=\"auto\"><hr /></div>\r\n</div>\r\n<p>Musculupatuddannelsen er en overbygning på massør- og sportsmassøruddannelsen på AM massageskole. Ligeledes er det en beskyttet titel, som giver dig som forbruger en sikkerhed i at behandlingen er kvalificeret, da det indenfor alternativ behandling kan være svært at differenciere kvaliteten.  <br />En Musculupatbehandling er en manuel muskulær behandlingsform, som bruger forskellige behandlingsteknikker til at afhælpe dit problem. I Musculupatien kigger vi på årsagen til dit problem fremfor at behandle symptomerne. Ligeledes tager vi højde for, hvordan psyken og fysikken kan påvirke hinanden. Nogle af de teknikker som bruges i Musculupatien er bla. fysiururgisk massage, pulsering, akupressur (dybe tryk), myofacsial release. <br />Ud fra et interview og en bevægeanalyse, sammensættes den optimale behandling for netop din problematik. <br />Tøv ikke med at kontakte os, hvis du har spørgsmål til behandlingen.</p>\r\n<div>[/lgc_column]</div>\r\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\r\n<div style=\"text-align: center;\">[maxbutton id=\"1\" ]</div>\r\n<div>[/lgc_column]</div>\r\n<div> </div>\r\n<div> </div>\r\n<div>\r\n<div class=\"csRow\">\r\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\r\n</div>\r\n</div>\r\n<div>\r\n<div class=\"csRow\">\r\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\r\n</div>\r\n</div>\r\n<!-- wp:paragraph --><!-- /wp:paragraph -->', 'Forside', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2020-07-28 22:09:14', '2020-07-28 21:09:14', '', 8, 'https://localhost/wordpress/sem4-hovedopgave-wp/2020/07/28/8-revision-v1/', 0, 'revision', '', 0);
