spørgsmål til behandlingen.</p>\r\n<div>[/lgc_column]</div>\r\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\r\n<div style=\"text-align: center;\">[maxbutton id=\"1\" ]</div>\r\n<div>[/lgc_column]</div>\r\n<div> </div>\r\n<div> </div>\r\n<div>\r\n<div class=\"csRow\">\r\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\r\n</div>\r\n</div>\r\n<div>\r\n<div class=\"csRow\">\r\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\r\n</div>\r\n</div>\r\n<!-- wp:paragraph --><!-- /wp:paragraph -->', 'Forside', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2020-08-06 14:14:12', '2020-08-06 13:14:12', '', 8, 'https://localhost/wordpress/sem4-hovedopgave-wp/2020/08/06/8-revision-v1/', 0, 'revision', '', 0),
(553, 1, '2020-08-06 14:15:58', '2020-08-06 13:15:58', '[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n<h1>Hvad behandler vi?</h1>\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Musculupati</h2>\r\nMusculupati kan hjælpe dig, hvis du har muskulære problematikker. Dette kan enten være på baggrund af en dårlig kropsholdning, forkert arbejdsstilling, eller en sportsskade. Ligeledes kan Musculupati bruges til at opnå hurtigere restitution, hvis man dyrker sport på eliteniveau som atlet eller hård træning som motionist, hvor især pulserende massageteknikker og akupressur er effektive metoder til at få musklerne afspændt. De mest almindelige muskulære problematikker som Musculupati kan afhælpe med er bla. generel anspændthed i kroppen, spændingshovedpine, tennis/golfalbue, løberknæ, føleforstyrrelser i arme eller ben, ondt i ryggen eller lænden. Tøv ikke med at kontakte os, hvis du har spørgsmål til om vi kan hjælpe dig med din problematik.\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Priser</h2>\r\n120 min - 900,-\r\n90 min - 700,-\r\n60 min - 500,-\r\n45 min - 400,-\r\n30 min - 300,-\r\n\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n\r\n<hr />\r\n\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Cupping terapi</h2>\r\nCupping terapi er inkluderet i en Musculupati behandling, hvis det vurderes relevant for din problematik, men cupping tilbydes også som en seperat behandling. Cupperne skaber et undertryk, som i det påsatte område gør at blodkarrene udvider sig, hvortil vævet og musklerne forsynes med friskt blod, ilt og næringsstoffer. Ligeledes øges blodgennemstrømningen i området, hvor temperaturen stiger og derved dræber bakterierne og på den måde frigives affaldsstofferne. Efter en cupping behandling er det derfor vigtigt at drikke rigeligt med vand, for at skylle de frigivne affaldsstoffer ud.\r\nHvis du tager antikoagulerende medicin, skal du rådføre dig med egen læge inden bestilling  af en cuppingbehandling.\r\n\r\nInden cupperne påsættes, varmes området op manuelt hvorefter cupperne sættes på i  15 min. Ved bestilling af Cupping terapi, er det muligt at vælge om man vil have cuppet 1, 2 eller 3 forskellige områder på kroppen. Områderne er opdelt således: bagside ben - ryg og nakke - forside ben - arme. Ved ønsket cupping af flere områder, cuppes 1 område af gangen.\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"50\" tablet_grid=\"50\" mobile_grid=\"100\" last=\"false\"]\r\n<h2>Priser</h2>\r\nCupping af 1 område, 30 min - 300,-\r\nCupping af 2 områder, 45 min - 400,-\r\nCupping af 3 områder, 60 min - 500,-\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n\r\n<hr />\r\n\r\n[/lgc_column]\r\n\r\n[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]\r\n\r\nSå <a href=\"https://localhost/wordpress/sem4-hovedopgave-wp/kontakt/\">kontakt</a> os eller <a href=\"https://localhost/wordpress/sem4-hovedopgave-wp/booking/\">book</a> en tid!\r\n\r\n[/lgc_column]', 'Priser og behandlinger', '', 'inherit', 'closed', 'closed', '', '261-revision-v1', '', '', '2020-08-06 14:15:58', '2020-08-06 13:15:58', '', 261, 'https://localhost/wordpress/sem4-hovedopgave-wp/2020/08/06/261-revision-v1/', 0, 'revision', '', 0),
