(555, 1, '2020-08-07 20:59:54', '2020-08-07 19:59:54', '<div>\r\n<div>[smartslider3 slider=4]</div>\r\n<div> </div>\r\n</div>\r\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\r\n<div class=\"n2-ss-layer n2-ow\" data-pm=\"normal\" data-desktopportraitmargin=\"0|*|0|*|0|*|0|*|px+\" data-desktopportraitheight=\"0\" data-has-maxwidth=\"0\" data-desktopportraitmaxwidth=\"0\" data-cssselfalign=\"center\" data-desktopportraitselfalign=\"center\" data-sstype=\"layer\" data-rotation=\"0\" data-desktopportrait=\"1\" data-desktoplandscape=\"1\" data-tabletportrait=\"1\" data-tabletlandscape=\"1\" data-mobileportrait=\"1\" data-mobilelandscape=\"1\" data-adaptivefont=\"0\" data-desktopportraitfontsize=\"100\" data-plugin=\"rendered\">\r\n<h1>Hvad er Musculupati?</h1>\r\n</div>\r\n<div>[/lgc_column]</div>\r\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\r\n<div>\r\n<h4 dir=\"auto\"><strong>I August måned er der halv pris på alle behandlinger, så du kan prøve en behandling.</strong></h4>\r\n<h4 dir=\"auto\"><strong>Brug rabatkoden: August50</strong></h4>\r\n<div dir=\"auto\"><hr /></div>\r\n</div>\r\n<p>Musculupat®uddannelsen er en 2 årig uddannelse inden for manuel behandling, specialiseret i muskulære problematikker. Ligeledes er det en beskyttet titel, som giver dig som forbruger en sikkerhed i at behandlingen er kvalificeret. I Musculupatien kigger vi på kroppens sammenhænge, både de fysiske og neurologiske, for at forstå årsagen til din problematik. Når du forstår årsagen til at din problematik opstår, kan du selv være med til at opretholde en smertefri tilstand og sørge for at din problemtik ikke bliver ved med at vende tilbage. Derfor starter 1. behandling med et kort interview samt bevægeanalyse, for at kunne give den optimale behandling for netop din problematik. I forlængelse af behandlingen, gives du enkle øvelser som kan laves uden brugen af rekvisitter, for at styrke de områder på kroppen, som kræver dette for at genoprette balancen i muskulaturen. Nogle af de manuelle teknikker som bruges i Musculupatien er bla. pulserende massageteknikker, akupressur (dybe tryk), myofacsial release, MET (muscle energy technique). Tøv ikke med at kontakte os, hvis du har spørgsmål til behandlingen.</p>\r\n<div>[/lgc_column]</div>\r\n<div>[lgc_column grid=\"100\" tablet_grid=\"100\" mobile_grid=\"100\" last=\"false\"]</div>\r\n<div style=\"text-align: center;\">[maxbutton id=\"1\" ]</div>\r\n<div>[/lgc_column]</div>\r\n<div> </div>\r\n<div> </div>\r\n<div>\r\n<div class=\"csRow\">\r\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\r\n</div>\r\n</div>\r\n<div>\r\n<div class=\"csRow\">\r\n<div style=\"clear: both; float: none; display: block; visibility: hidden; width: 0px; font-size: 0px; line-height: 0;\"> </div>\r\n</div>\r\n</div>\r\n<!-- wp:paragraph --><!-- /wp:paragraph -->', 'Forside', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2020-08-07 20:59:54', '2020-08-07 19:59:54', '', 8, 'https://localhost/wordpress/sem4-hovedopgave-wp/2020/08/07/8-revision-v1/', 0, 'revision', '', 0),
